(def individuals (map #(filter-out-generation-num %) run-data))
(def all-individuals (map #(filter-out-archive %) individuals))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/all-individuals</span>","value":"#'user/all-individuals"}
;; <=

;; @@
(def average (/ (reduce + (map #(count-nodes %) (last all-individuals))) (count (last all-individuals))))
(def average-of-squares (/ (reduce + (map #(* (count-nodes %) (count-nodes %)) (last all-individuals))) (count (last all-individuals))))
(def stdev (- average-of-squares (* average average)))
